import isNotNilObject from '../isNotNilObject';
import { formatJSVal } from '../testUtils';
describe('isNotNilObject', function () {
  var itHelper = function itHelper(input, expected) {
    return it("".concat(formatJSVal(input), " should be ").concat(expected), function () {
      expect(isNotNilObject(input)).toBe(expected);
    });
  };

  itHelper({}, true);
  itHelper([], true);
  itHelper(function () {}, true);
  itHelper(null, false);
  itHelper(undefined, false);
  itHelper(1, false);
  itHelper('', false);
  itHelper(false, false);
});